import React, { useEffect, useState } from "react";
import companylogo from "../image/company-logo.png";

function Home() {
  const [one, setone] = useState(false);
  const [one2, setone2] = useState(false);
  useEffect(() => {
    line();
    line2();
  }, []);

  const line = () => {
    setTimeout(() => {
      setone(!one);
    }, 3000);
  };

  const line2 = () => {
    setTimeout(() => {
      setone2(!one2);
    }, 6000);
  };

  return (
    <>

      <section className="company-add">
        <div className="add-image">
          <div className="container-fluid">
            <div className="add"></div>
          </div>
          <div className={one2 === true ? "quotes2" : "quotes"}>
            <div className="container">
              <div className="company-quotes">
                <div className={one === true ? "quotes2" : "quotes1"}>
                  <h3 className="line">
                    <span>An</span> in house website and mobile
                  </h3>
                  <h3 className="line">
                    application and develping company ...
                  </h3>
                </div>

                <div className={one === true ? "nxtquotes" : "nxtquotes2"}>
                  <h3 className="line">
                    {" "}
                    <span>WE</span> are building our own brands
                  </h3>
                  <h3 className="line">registared and recognasize india ...</h3>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

    
    </>
  );
}

export default Home;
